import React, { Component } from 'react'

export default class Navbar extends Component {
  render() {
    return (
      <div>
          
          <div className='dd'>
            <h2>{this.props.title}{this.state.conTextt}</h2>
            <li>ana</li>
            <li>baba</li>
            <li>saba</li>
            <li>dada</li>
            </div>

      </div>
    )
  }
}
